DROP TABLE IF EXISTS staff;

CREATE TABLE staff (
    staff_id INTEGER,
    name TEXT,
    role TEXT,
    department TEXT,
    contact_number DATETIME,
    email TEXT,
    qualification TEXT,
    experience_years INTEGER,
    shift_preference TEXT,
    hourly_rate REAL,
    is_active INTEGER,
    hired_date DATETIME,
    created_at DATETIME,
    updated_at DATETIME
);

